import './App.css';
import Particles from 'react-particles-js';

import HomePage from './pages/homepage/homepage.components';
const App = () => {
  return (
    <div className="App">
      {/* <HomePage/> */}
      By Ankit Bansal 
      <Particles params={{ 
          particles: { 
            number: { 
              value: 200, 
              density: { 
                enable: true, 
                value_area: 1000, 
              } 
            }, 
          }, 
        }} />
    </div>
  );
}

export default App;
